function recolorMap(){var rng=getRange(),i,reg,cell,v;for(i=0;i<REGIONS.length;i++){reg=REGIONS[i];cell=document.getElementById('cell-'+reg.key);if(!cell)continue;v=DATA[reg.key]!==undefined?DATA[reg.key]:null;cell.className='map-cell'+(v===null?' no-data':'');cell.style.background=toColor(v,rng.min,rng.max);cell.style.color=toTxtColor(v,rng.min,rng.max);}}

function fitMap(){
    var area=document.getElementById('map-area'),mc=document.getElementById('map-container');
    if(!area||!mc||!mc.children.length)return;
    var mxC=0,mxR=0,i;for(i=0;i<REGIONS.length;i++){if(REGIONS[i].col>mxC)mxC=REGIONS[i].col;if(REGIONS[i].row>mxR)mxR=REGIONS[i].row;}
    var gW=(mxC+1)*56+mxC*3,gH=(mxR+1)*56+mxR*3;
    var aw=area.clientWidth-20,ah=area.clientHeight-20;
    if(aw<=0||ah<=0)return;
    var sw=aw/gW,sh=ah/gH;
    mapScale=sw<sh?sw:sh;if(mapScale>1)mapScale=1;
    mc.style.transform='scale('+mapScale+')';mc.style.transformOrigin='center center';
}
window.fitMap=fitMap;
window.recolorMap=recolorMap;
window.updatePanel=updatePanel;
function refreshAbbrBadge(){if(!selectedKey)return;var v=DATA[selectedKey];var rng=getRange();var regC=toColor(v,rng.min,rng.max);var avgC=toColor(rng.avg,rng.min,rng.max);var txC=toTxtColor(v,rng.min,rng.max);var isGlass=document.body.classList.contains('theme-glass');var isMint=document.body.classList.contains('theme-mint');var diff=v!==null?v-rng.avg:0;var dCol=isGlass?(diff>=0?'#69db7c':'#C62828'):isMint?(diff>=0?'#1565C0':'#C62828'):(diff>=0?'#00838f':'#C62828');var el;el=document.getElementById('info-abbr');if(el){el.style.setProperty('background',regC,'important');el.style.setProperty('color',txC,'important');}el=document.getElementById('info-td');if(el)el.style.setProperty('background',regC,'important');el=document.getElementById('info-rank');if(el){el.style.background=regC;el.style.color=txC;}el=document.getElementById('info-v-reg');if(el)el.style.color=regC;el=document.getElementById('info-bf-reg');if(el)el.style.background=regC;el=document.getElementById('info-diff-v');if(el)el.style.color=dCol;el=document.getElementById('info-bf-avg1');if(el)el.style.background=dCol;el=document.getElementById('info-v-avg');if(el)el.style.color=avgC;el=document.getElementById('info-bf-avg2');if(el)el.style.background=avgC;}
window.updateAbbrBadge=refreshAbbrBadge;

function initButtons(){
    var btns=document.querySelectorAll('.nbtn'),i;
    for(i=0;i<btns.length;i++){(function(btn){btn.addEventListener('click',function(){var row=btn.closest('.crow'),lvl=parseInt(row.dataset.level,10),key=btn.dataset.key,val=btn.dataset.val,showId=btn.dataset.show,wasOn=btn.classList.contains('on'),j,sib;if(wasOn){btn.classList.remove('on');if(lvl===1){hideFrom(2);S.type=null;S.year=null;S.field=null;}else if(lvl===2){hideFrom(3);S.year=null;S.field=null;}else{S.field=null;}resetGray();return;}sib=row.querySelectorAll('.nbtn');for(j=0;j<sib.length;j++)sib[j].classList.remove('on');btn.classList.add('on');if(key==='type'){S.type=val;S.year=null;S.field=null;hideFrom(2);resetGray();}else if(key==='year'){S.year=val;S.field=null;var r3=document.getElementById('r-view');if(r3){r3.classList.add('crow-off');var r3b=r3.querySelectorAll('.nbtn');for(j=0;j<r3b.length;j++)r3b[j].classList.remove('on');}resetGray();}else if(key==='view'){S.field=val;applyFilter();}if(showId){var nx=document.getElementById(showId);if(nx)nx.classList.remove('crow-off');}setTimeout(fitMap,10);});}(btns[i]));}
}

function hideFrom(lvl){var rows=document.querySelectorAll('#nav-rows .crow[data-level]'),i,j,btns;for(i=0;i<rows.length;i++){if(parseInt(rows[i].dataset.level,10)>=lvl&&rows[i].id){rows[i].classList.add('crow-off');btns=rows[i].querySelectorAll('.nbtn');for(j=0;j<btns.length;j++)btns[j].classList.remove('on');}}}
function resetGray(){var i;for(i=0;i<REGIONS.length;i++)DATA[REGIONS[i].key]=null;recolorMap();selectedKey=null;updateSel();closeInfo();hidePB();}
function hidePB(){var h=document.getElementById('panelHint'),b=document.getElementById('panelBody');if(h)h.style.display='flex';if(b)b.style.display='none';}
function showPB(){var h=document.getElementById('panelHint'),b=document.getElementById('panelBody');if(h)h.style.display='none';if(b)b.style.display='flex';}

function updatePanel(){
    var isRes=S.field==='result',rng=getRange(),el;
    el=document.getElementById('leg-title');if(el)el.textContent=isRes?'Шкала результатов':'Шкала явки';
    el=document.getElementById('lbl-avg');if(el)el.textContent=isRes?'Результат':'Явка';
    var t1=document.getElementById('leg-t1'),t2=document.getElementById('leg-t2'),t3=document.getElementById('leg-t3'),gd=document.getElementById('leg-grad');
    if(rng.count){
        if(t1)t1.textContent=fmtPct(rng.min);if(t2)t2.textContent=fmtPct(rng.avg);if(t3)t3.textContent=fmtPct(rng.max);
        if(gd){
            var tc=getThemeColors();
            if(tc.type==='ryg'){
                gd.style.background='linear-gradient(to right,'+toColor(0,0,1)+','+toColor(0.5,0,1)+','+toColor(1,0,1)+')';
            } else {
                gd.style.background='linear-gradient(to right,'+toColor(rng.min,rng.min,rng.max)+','+toColor(rng.max,rng.min,rng.max)+')';
            }
        }
    }
    else{if(t1)t1.textContent='—';if(t2)t2.textContent='—';if(t3)t3.textContent='—';}
    el=document.getElementById('stat-avg');if(el)el.textContent=rng.count?fmtPct(rng.avg):'—';
    el=document.getElementById('stat-cnt');if(el)el.textContent=rng.count;
    el=document.getElementById('stat-cnt-s');if(el)el.textContent='с данными из '+REGIONS.length;
    var wd=[],i,v;for(i=0;i<REGIONS.length;i++){v=DATA[REGIONS[i].key];if(v!==null&&v!==undefined)wd.push(REGIONS[i]);}
    if(wd.length){wd.sort(function(a,b){return DATA[a.key]-DATA[b.key];});el=document.getElementById('stat-min');if(el)el.textContent=fmtPct(DATA[wd[0].key]);el=document.getElementById('stat-min-r');if(el)el.textContent=shn(wd[0].name);el=document.getElementById('stat-max');if(el)el.textContent=fmtPct(DATA[wd[wd.length-1].key]);el=document.getElementById('stat-max-r');if(el)el.textContent=shn(wd[wd.length-1].name);}
    else{['stat-min','stat-min-r','stat-max','stat-max-r'].forEach(function(id){el=document.getElementById(id);if(el)el.textContent='—';});}
    /* Перекрашиваем квадратики списка при смене темы */
    buildList((document.getElementById('search')||{}).value||'');
}

function buildList(filter){
    var list=document.getElementById('region-list');if(!list)return;
    list.innerHTML='';
    var lf=filter.toLowerCase(),rng=getRange(),wd=[],nd=[],i,r,v;
    for(i=0;i<REGIONS.length;i++){r=REGIONS[i];v=DATA[r.key];if(v!==null&&v!==undefined)wd.push(r);else nd.push(r);}
    wd.sort(function(a,b){return DATA[b.key]-DATA[a.key];});
    var all=wd.concat(nd);
    for(i=0;i<all.length;i++){(function(reg){if(lf&&reg.name.toLowerCase().indexOf(lf)<0&&reg.abbr.toLowerCase().indexOf(lf)<0)return;v=DATA[reg.key]!==undefined?DATA[reg.key]:null;var li=document.createElement('div');li.className='rli'+(selectedKey===reg.key?' active':'');li.dataset.key=reg.key;li.innerHTML='<div class="rli-dot" style="background:'+toColor(v,rng.min,rng.max)+';border:1px solid rgba(0,0,0,.1)"></div><span class="rli-name">'+reg.name+'</span>'+(v!==null?'<span class="rli-pct">'+fmtPct(v)+'</span>':'<span class="rli-nodata">н/д</span>');li.onclick=function(){clickRegion(reg.key);};list.appendChild(li);}(all[i]));}
}

function clickRegion(key){if(selectedKey===key){selectedKey=null;closeInfo();}else{selectedKey=key;openInfo(key);}updateSel();buildList((document.getElementById('search')||{}).value||'');}
function updateSel(){var cells=document.querySelectorAll('.map-cell'),items=document.querySelectorAll('.rli'),i;for(i=0;i<cells.length;i++){cells[i].classList.remove('selected','dim');if(selectedKey)cells[i].classList.add(cells[i].dataset.key===selectedKey?'selected':'dim');}for(i=0;i<items.length;i++){if(items[i].dataset.key===selectedKey)items[i].classList.add('active');else items[i].classList.remove('active');}}

function openInfo(key){
    var reg=null,i;for(i=0;i<REGIONS.length;i++){if(REGIONS[i].key===key){reg=REGIONS[i];break;}}if(!reg)return;
    var v=DATA[key]!==undefined?DATA[key]:null,el;
    el=document.getElementById('info-title');if(el)el.textContent=reg.name;
    el=document.getElementById('info-abbr');if(el){el.textContent=reg.abbr;var _rng=getRange();var _bgC=toColor(v,_rng.min,_rng.max);var _txC=toTxtColor(v,_rng.min,_rng.max);el.style.setProperty('background',_bgC,'important');el.style.setProperty('color',_txC,'important');}
    var body=document.getElementById('info-body');if(!body)return;body.innerHTML='';
    if(v===null){body.innerHTML='<div class="no-data-panel fade-in"><div class="nd-icon">📭</div><div class="nd-text">Нет данных</div><div class="nd-sub">За выбранный период данные<br>по региону отсутствуют</div></div>';}
    else{
        var rng=getRange(),wd=[],rank=0;
        for(i=0;i<REGIONS.length;i++){var dv=DATA[REGIONS[i].key];if(dv!==null&&dv!==undefined)wd.push(REGIONS[i]);}
        wd.sort(function(a,b){return DATA[b.key]-DATA[a.key];});
        for(i=0;i<wd.length;i++){if(wd[i].key===key){rank=i+1;break;}}
        var diff=v-rng.avg;
        /* Форматируем отклонение с запятой и без лишних нулей */
        function fmtDiff(d){
            var s=Math.abs(d).toFixed(2).replace(/\.?0+$/,'').replace('.',',');
            return(d>=0?'+':'\u2212')+s+'\u00A0%';
        }
        var isGlass=document.body.classList.contains('theme-glass');
        var isMint=document.body.classList.contains('theme-mint');
        /* Цвет отклонения: Мятная — бирюз/красный, Кобальт — синий/красный, Графит — зел/красный */
        var dCol=isGlass
            ?(diff>=0?'#69db7c':'#C62828')
            :isMint
                ?(diff>=0?'#1565C0':'#C62828')
                :(diff>=0?'#00838f':'#C62828');
        var nV=rng.max>rng.min?(v-rng.min)/(rng.max-rng.min):0;
        var nA=rng.max>rng.min?(rng.avg-rng.min)/(rng.max-rng.min):0;
        var wDev=diff>=0?(rng.max>rng.avg?Math.min(diff/(rng.max-rng.avg)*100,100):0):(rng.avg>rng.min?Math.min(Math.abs(diff)/(rng.avg-rng.min)*100,100):0);
        var lbl=S.field==='result'?'Результат':'Явка';
        var regColor=toColor(v,rng.min,rng.max);
        var avgColor=toColor(rng.avg,rng.min,rng.max);
        body.innerHTML=
            '<div id="info-td" class="turnout-display fade-in" style="background:'+regColor+'"><div class="td-label">'+lbl+'</div><div class="td-value">'+fmtPct(v)+'</div><div class="td-sub">'+(S.year||'')+' · '+(S.type||'')+'</div></div>'+
            (rank?'<div id="info-rank" class="rank-badge fade-in" style="background:'+regColor+';color:'+toTxtColor(v,rng.min,rng.max)+'">🏆 '+rank+' место из '+wd.length+'</div>':'')+
            '<div class="info-metric fade-in"><div class="im-label">'+lbl+' по шкале</div><div id="info-v-reg" class="im-value" style="color:'+regColor+'">'+fmtPct(v)+'</div><div class="im-bar"><div id="info-bf-reg" class="im-bar-fill" style="width:'+v.toFixed(1)+'%;background:'+regColor+'"></div></div></div>'+
            '<div class="info-metric fade-in"><div class="im-label">Отклонение от среднего</div><div id="info-diff-v" class="im-value" style="color:'+dCol+'">'+fmtDiff(diff)+'</div><div class="im-bar"'+(diff<0?' style="display:flex"':'')+'>  <div id="info-bf-avg1" class="im-bar-fill" style="width:'+wDev.toFixed(1)+'%;background:'+dCol+';opacity:.7'+(diff<0?';margin-left:auto':'')+'"></div></div></div>'+
            '<div class="info-metric fade-in"><div class="im-label">Среднее по регионам</div><div id="info-v-avg" class="im-value" style="color:'+avgColor+'">'+fmtPct(rng.avg)+'</div><div class="im-bar"><div id="info-bf-avg2" class="im-bar-fill" style="width:'+rng.avg.toFixed(1)+'%;background:'+avgColor+';opacity:.7"></div></div></div>';
    }
    var panel=document.getElementById('info-panel');
    if(panel){panel.classList.add('open');setTimeout(fitMap,270);}
}
function closeInfo(){
    var panel=document.getElementById('info-panel');
    if(panel)panel.classList.remove('open');
    selectedKey=null;updateSel();
    setTimeout(fitMap,270);
    var rl=document.getElementById('region-list');
    if(rl&&rl.children.length)buildList((document.getElementById('search')||{}).value||'');
}
window.closeInfo=closeInfo;

function showTip(e,reg){var tt=document.getElementById('tooltip');if(!tt)return;var v=DATA[reg.key]!==undefined?DATA[reg.key]:null,rng=getRange(),norm=v!==null&&rng.max>rng.min?(v-rng.min)/(rng.max-rng.min):0,cls=norm>0.65?'high':norm>0.35?'mid':'low',diff=v!==null?v-rng.avg:null,dStr=diff!==null?(diff>=0?'▲ +':'▼ ')+diff.toFixed(1)+'% от среднего':'';tt.innerHTML='<div>'+reg.name+'</div><div class="tt-pct '+cls+'">'+fmtPct(v)+'</div>'+(diff!==null?'<div class="tt-sub">'+dStr+'</div>':'<div class="tt-sub">Нет данных</div>');tt.classList.add('visible');moveTip(e);var items=document.querySelectorAll('.rli[data-key="'+reg.key+'"]'),i;for(i=0;i<items.length;i++)items[i].style.background='var(--row-bg)';}
function moveTip(e){var tt=document.getElementById('tooltip');if(tt){tt.style.left=(e.clientX+14)+'px';tt.style.top=(e.clientY-12)+'px';}}
function hideTip(){var tt=document.getElementById('tooltip');if(tt)tt.classList.remove('visible');var items=document.querySelectorAll('.rli'),i;for(i=0;i<items.length;i++)items[i].style.background='';}

function zoomMap(dir){if(dir===0){fitMap();return;}mapScale+=dir*0.15;if(mapScale<0.2)mapScale=0.2;if(mapScale>3)mapScale=3;var mc=document.getElementById('map-container');if(mc){mc.style.transform='scale('+mapScale+')';mc.style.transformOrigin='center center';}}
